module.exports = /*#__PURE__*/JSON.parse('{"englishSentences":["TikTok Restored But Future Uncertain","TikTok users in the U.S. were able to regain access to the popular social media app Sunday after assurances from President Donald Trump he would delay enforcement of a ban.","On Monday, he signed an executive action to delay the ban for 75 days.","TikTok shut down service for about 14 hours Saturday night, blocking the roughly 170 million American users from gaining access.","Last year, Congress passed a law banning the app over security concerns about how the Chinese company was using Americans\' information.","TikTok and its China-based owner ByteDance sued the U.S. government, and the case went to the Supreme Court, which upheld the ban last week.","\\"What we want is, we don\'t want China spying on Americans. We don\'t want China influencing young people.\\"","In the law, Congress gave TikTok\'s parent company until January 19th to sell the app to a buyer from America or one of its allies, or face it being blocked.","That\'s why the app decided to go dark, infuriating many users like Joanne Molinaro, who depends on the platform for business.","\\"I do need TikTok to continue engaging with the community that I\'ve spent over four and a half years building.\\"","While users have regained access, it may not be permanent.","In Trump\'s executive order, he says he gave himself the right to force the company to sell or close it.","\\"The president is going to have to become more serious about finding a resolution to these issues.","We want to keep TikTok up, but we have to resolve the national security issues.\\"","If ByteDance refuses to sell TikTok, it could go dark in the U.S. again."],"koreanSentences":["틱톡 서비스 복구됐지만, 미래는 불확실","도널드 트럼프 대통령이 틱톡 금지 조치를 연기하겠다고 발표한 후, 미국 내 틱톡 사용자들은 일요일에 다시 앱을 사용할 수 있게 되었다.","월요일, 그는 75일 동안 금지를 연기하는 행정 명령에 서명했다.","토요일 밤, 틱톡은 약 14시간 동안 서비스를 중단하며 약 1억 7천만 명의 미국 사용자의 접속을 차단했다.","지난해, 미국 의회는 중국 기업이 미국인의 정보를 어떻게 사용하는지에 대한 보안 우려로 틱톡을 금지하는 법안을 통과시켰다.","이에 대해 틱톡과 중국 모기업 바이트댄스는 미국 정부를 상대로 소송을 제기했으며, 이 사건은 대법원으로 갔고, 지난주 대법원은 금지 조치를 유지하기로 판결했다.","“우리가 원하는 것은 중국이 미국인을 감시하지 않는 것입니다. 우리는 중국이 젊은 세대에 영향을 미치는 것을 원하지 않습니다.”","이 법안에 따르면, 미국 의회는 틱톡의 모기업에 1월 19일까지 미국이나 동맹국의 기업에 앱을 매각하지 않으면 차단될 것이라고 경고했다.","이러한 이유로 틱톡은 서비스를 중단했으며, 비즈니스 용도로 틱톡을 활용하는 조앤 몰리나로 같은 사용자들은 이에 분노했다.","“저는 틱톡을 통해 4년 반 동안 구축한 커뮤니티와 계속 소통해야 합니다.”","사용자들은 다시 틱톡에 접속할 수 있게 되었지만, 이는 영구적인 조치가 아닐 수도 있다.","트럼프의 행정명령에 따르면, 그는 틱톡을 강제 매각하거나 폐쇄할 권한을 자신에게 부여했다.","“대통령은 이 문제의 해결책을 찾는 데 더욱 진지해져야 합니다. 우리는 틱톡을 유지하고 싶지만, 국가 안보 문제를 해결해야 합니다.”","바이트댄스가 틱톡 매각을 거부한다면, 미국에서 다시 서비스가 중단될 수도 있다."]}');

